import React from "react";
// styles
import Grid from "@mui/material/Grid";
import TextField from '@mui/material/TextField';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';
// コンポーネント
import { BookCard } from '../../components/Books/BookCard'
import { BookNameSerch } from "../../components/Forms/BookSeach";

export const BooksList = () => {

  return (
    <Grid container sx={{ maxWidth: 1000, mx: "auto", bgcolor: 'grey.300' }}>
      <Grid item sm={12} sx={{ px: 2, bgcolor: 'grey.200' }}>
        <p>書籍名で検索</p>
        <BookNameSerch />
      </Grid>
      <Grid item sm={12} sx={{ p: 2, bgcolor: 'grey.400' }}>
        <h3>検索結果</h3>
        <h4>書籍（？？件）</h4>
      </Grid>

      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>
      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>
      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>
      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>
      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>
      <Grid item xs={6} sm={4} sx={{ px: 2, bgcolor: 'grey.100' }}>
        <BookCard />
      </Grid>

    </Grid>
  )
}
